import React from "react";

export default function parcelItem(
  name,
  parcels,
  pickupLocation,
  address,
  orderStatus
) {
  return (
    <div className="display">
      <h1>{name}</h1>
      <p className="parcelItem-parcels">{parcels}</p>
      <p className="parcelItem-pickuplocation">{pickupLocation} </p>
      <p className="parcelItem-address">{address} </p>
      <p className="ParcelItem-orderStatus">{orderStatus} </p>
    </div>
  );
}
